import Button from "@mui/material/Button";
import Dialog from "@mui/material/Dialog";
import "../Dashboard.css";
import Student from "../images/Student.png";
import { useNavigate } from "react-router-dom";
import React from "react";

const ReceiptDialog = ({ open, handleClose, openSignup }) => {
  const [user, setUser] = React.useState("");

  const handleData = () => {
    setUser("");
    }

  return (
    <div>
      <Dialog
        classes={{ paper: "submit-form" }}
        open={open}
        onClose={handleClose}
      >
        <img className="dialog-title" src={Student} alt="firespot" />
        <div className="title-heading">
          <div className="sign-in">Sign In</div>
          <div className="uom-user">UOM User</div>
        </div>
        <div className="signin-text">
          <Button className="signin" onClick={() => handleData()}>
            Sign in
          </Button>
        </div>
        <div className="hr-main">
          <hr className="hr" />
          or
          <hr className="hr" />
        </div>
        <div className="dont-have">
          <div>Don't have an Account ?</div>
          <div>
            <button className="create-new-one" onClick={openSignup}>
              <u>Create New One</u>
            </button>
          </div>
        </div>
      </Dialog>
    </div>
  );
};
export default ReceiptDialog;
